import React from "react";
import mock01 from '../assets/images/mock01.png';
import pr1 from '../assets/images/projekt1.png';
import pr2 from '../assets/images/projekt2.png';
import '../assets/styles/Project.scss';

function Project() {
    return(
    <div className="projects-container" id="projects">
        <h1>Personal Projects</h1>
        <div className="projects-grid">
            <div className="project">
                <a href="https://github.com/JacekwPL/Snake-game-in-arduino" target="_blank" rel="noreferrer"><img src={pr1} className="zoom" alt="thumbnail" width="100%"/></a>
                <a href="https://github.com/JacekwPL/Snake-game-in-arduino" target="_blank" rel="noreferrer"><h2>Snake Game on Arduino</h2></a>
                <p>Projekt czeka a czasu coraz mniej haha, więc tutaj już na łatwiznę idę, można kilknąć na zdjęcie i one prowadzą do jakiś tam projektów.</p>
            </div>
            <div className="project">
                <a href="https://github.com/poprostupiotrus/ProjektIO" target="_blank" rel="noreferrer"><img src={pr2} className="zoom" alt="thumbnail" width="100%"/></a>
                <a href="https://github.com/poprostupiotrus/ProjektIO" target="_blank" rel="noreferrer"><h2>Inwestuj roztropnie</h2></a>
                <p>Inwestuj Roztropnie is an advanced analytical application that leverages the latest data from the PAP Biznes website, a leading Polish business portal providing up-to-date news, analyses, and reports on the economic, financial, and business situation in Poland. The application uses cutting-edge machine learning algorithms (LLM) to forecast changes in the values of the largest stock companies in Poland. By analyzing historical trends and current events, it delivers precise predictions on future stock values to users.</p>
            </div>
        </div>
    </div>
    );
}

export default Project;
